CREATE DEFINER=`root`@`localhost` PROCEDURE `getQueue`()
BEGIN
IF dayofweek(now()) = 6
THEN
	select distinct dtop_id, slot_id from queue
	join user using (user_num) join timeslot using (slot_id)
    WHERE date between (select DATE(DATE_ADD(now(), INTERVAL 3 DAY))) 
						and (select DATE(DATE_ADD(now(), INTERVAL 9 DAY)))
	ORDER BY slot_id;
ELSEIF dayofweek(now()) = 5
THEN
	select distinct dtop_id, slot_id from queue
	join user using (user_num) join timeslot using (slot_id)
    WHERE date between (select DATE(DATE_ADD(now(), INTERVAL 4 DAY))) 
						and (select DATE(DATE_ADD(now(), INTERVAL 10 DAY)))
                        ORDER BY slot_id;
ELSE
	select distinct dtop_id, slot_id from queue
	join user using (user_num) join timeslot using (slot_id)
    WHERE date between (select date(now())) and (select DATE(DATE_ADD(now(), INTERVAL 14 DAY)))  -- not for production use
    ORDER BY slot_id;    
END IF;
END ;;
