CREATE DEFINER=`root`@`localhost` PROCEDURE `GetRequests`()
BEGIN
	SELECT COUNT(queue.qid) AS count, 
	queue.slot_id AS slotID, 
	timeslot.date AS reserveDate, 
	timeslot.start_time AS reserveTime, 
	desktop.name AS dtopName, 
	queue.dtop_id AS dtop_num, 
	queue.user_num AS userID, 
	user.username AS username, 
	user.first_name AS firstName, 
	user.last_name AS lastName 
	FROM queue 
	INNER JOIN user ON 
	queue.user_num = user.user_num 
	INNER JOIN desktop ON 
	queue.dtop_id = desktop.dtop_id 
	INNER JOIN timeslot ON 
	queue.slot_id = timeslot.slot_id 
	GROUP BY slotID;
END ;;
