CREATE DEFINER=`root`@`localhost` PROCEDURE `managerUserBuildTotal`(IN `startDate` DATE, IN `endDate` DATE, IN `departID` INT)
BEGIN
select u.name, u.b_name, (select count(*)*3 from user_request_data where received = 1 and name = u.name and u.b_name = b_name) as reserved,
					(select count(*)*3 from user_request_data where received = 0 and name = u.name and u.b_name = b_name) as unfulfilled
from user_request_data u
where department_id = departID and date BETWEEN startDate and endDate
GROUP BY u.name, u.b_name;
END ;;
