CREATE DEFINER=`root`@`localhost` PROCEDURE `mtrTest`(IN `userNum` INT(11), IN `dtop` INT(11), IN `slotnum` INT(11), IN `primeMod` INT, IN `nonPrimeMod` INT, IN `consolationMod` INT, IN `bnum` INT, IN `note` VARCHAR(100) CHARSET utf8)
BEGIN
	call archiveLeftover; -- "deactivates" old requests,
    -- activeBit of 1 implies the user can make second round picks.
   
	INSERT INTO baileyc5.reservation(user_num,slot_id,dtop_id,b_num,note)
    SELECT userNum, slotnum, dtop, bnum, note; -- insert winner
    
	SELECT start_time
    into @starttime
	from user
    join reservation using (user_num) -- find time slot start time
    join timeslot using (slot_id)
    WHERE user_num = userNum and dtop_id = dtop and slot_id = slotnum and b_num = bnum;
    
    IF 	   @starttime between '09:00:00' 
		   and '15:00:00' -- adjust points
	THEN
		UPDATE user
        SET user_points = user_points + primeMod 
        where user_num = userNum;		
	ELSE
		 UPDATE user
		 SET user_points = user_points + nonPrimeMod
         where user_num = userNum;
	END IF;     
    
    DELETE FROM queue     
    WHERE dtop_id = dtop and user_num = userNum and slot_id = slotnum and b_num = bnum;
    
    UPDATE user    
    join queue using (user_num)
    SET user_points = user_points + consolationMod, num_requests = num_requests - 1
    where dtop_id = dtop and slot_id = slotnum and b_num = bnum;
    
	Insert into leftover (dtop_id, slot_id, b_num, user_num, request_time)
    select dtop_id, slot_id, b_num, user_num, request_time from queue
    where dtop_id = dtop and slot_id = slotnum and b_num = bnum;
    
    DELETE FROM queue
    WHERE dtop_id = dtop AND slot_id = slotnum and b_num = bnum;
    

END ;;
